    [],nt"num_tags": 4,nt"name": "sandhill-crane-aerial-surveys-in-alaska-and-the-yukon-territory-1957-1980",nt"isopen":
    false,nt"url": null,nt"notes": "Sandhill cranes have been recorded on Alaska
    waterfowl breeding population surveys since 1957. Aerial observations provide mean
    indexes of 2,200 cranes for spruce-muskeg habitat and 26,600 for tundra habitat,
    a total of 28,800 for Alaska. These indexes have been expanded with limited visibility
    correction factors for respective habitats yielding mean populations of 23,100 for
    spruce-muskeg and 98,400 for tundra, a total of 121,500 for Alaska. Significant
    positive correlations (r =.22, p <.05 for indexes; r 2 =.27: p <.01 for visibility
    corrected indexes) result when breeding population survey data is compared with
    Nebraska sandhill crane spring migration counts. The value of survey results could
    be increased with additional effort. The data show an increase in the Alaska sandhill
    crane breeding population 1957-1980, a 24 year period of consistent standard aerial
    waterfowl survey effort.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
